        "type": "geoinstance",
        "text": "Probably somewhere in East Africa, possibly in the area of the Afar people, between Adulis and Djibouti, on the location of the ancient D'mt (Da'amat) kingdom and close to the Kush kingdom and its gold mines, where they could also find silver, ivory, apes, and peacocks. Other possible locations for Punt are Mundus-Mosylium and Opone (Somalia) (3616)",
