        "type": "geoinstance",
        "text": "El Port de la Selva? \u00ab Le Pyrenee \u00bb generally means the oriental extremity of this chain of mountains that literally falls into the sea between Port Vendres in France and Roses in Spain. Its end is Cape Creus. Shelters are few and of bad quality, as they face the East, and the mountain is hostile. The best shelter is Port de la Selva on the Spanish side. Note that Herodotus (Hist. 2, 33) erroneously placed the source of the Danube here Geometry (451_geom)",
